import Link from "next/link";

const artists = ["maxlabor", "kiptok", "joy"];

const TopFiles = () => (
  <div>
    {/* <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link> */}

    {artists.map(artiste => (
      <Link href="/[id]" as={`/${artiste.id}`}>
        <div className="fileContainer" key={artiste.id}>
          <img className="iconImg" src="/Folder-icon.png" />
          <a>{artiste.artist}</a>
        </div>
      </Link>
    ))}

    <style jsx>{`
      h1,
      a {
        font-family: serif;
      }
      .fileContainer {
        padding: 10px 15px;
        border-radius: 5px;
        border: 1px solid #d0d0d0;
        margin-right: 12px;
        margin-bottom: 12px;
        display: inline-block;
        transition: all 0.2s;
        box-shadow: 3px 3px 0px rgba(0, 0, 0, 0.19);
        cursor: pointer;
      }
      .fileContainer:hover {
        box-shadow: 5px 5px 0px rgba(0, 0, 0, 0.14);
        // border: 1px solid #c8c8c8;
      }
      .iconImg {
        display: inline-block;
        margin: 0;
        padding: 0;
      }
      .fileContainer > * {
        vertical-align: middle;
      }
      a {
        text-decoration: none;
        color: #484848;
        padding-left: 9px;
        transition: all 0.3s;
        font-family: "Helvetica Neue", sans-serif;
      }

      .fileContainer:hover a {
        //
      }
    `}</style>
  </div>
);

export default TopFiles;
